import http from "../http-common";

const getAll = () => {
    return http.get("/supportsInv");
};

const getById = id => {
    return http.get(`/supportsInv/${id}`);
};

const getByPropositionId = id => {
    return http.get(`supportsInv/getByPropositionId/${id}`);
};


export default {
    getAll,
    getById,
    getByPropositionId
};
